import frontCoverImg from '../media/frontCoverImg.png'
import '../style/home.css';

const Home = () => {
    return ( 
        <div className="Home">
        <img src={frontCoverImg} alt="freelancer" className='frontCoverImg' />
        </div>
    );
}

export default Home;
